import React from "react";
import Planets from "./Planets";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Planets />
      <div id="response"></div>

      <header className="App-header">
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Used by
        </a>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
      </header>
    </div>
  );
}

export default App;
